import React from "react";

const Card = ({ pokemon }) => {
  return (
    <div>
      <div className="card">
        <div className="pkmn__container">
          <div className="pkmn__picture">
            <div className="pkmn__cp">#{pokemon.id}</div>
            <img
              className="pkmn__png object-fill h-28"
              src={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/other/dream-world/${pokemon.id}.svg`}
              alt={pokemon.name}
            />
          </div>
          <div className="pkmn__info">
            <div className="pkmn__name">{pokemon.name}</div>
            <div className="pkmn__data">
              <div className="pkmn__type">Attack: {pokemon.attack}</div>
              <div className="pkmn__weight">Defense: {pokemon.defense}</div>
              <div className="pkmn__type">Speed: {pokemon.speed}</div>
              <div className="pkmn__height">HP: {pokemon.hp}</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Card;
